import React from 'react';
import { useSelector } from 'react-redux'
import { useHistory } from 'react-router-dom';

function ChangeAccount() {

    const history = useHistory();
    const nameState = useSelector((state) => {return state.nameReducer});
    const emailState = useSelector((state) => {return state.emailReducer});
    const passwordState = useSelector((state) => {return state.passwordReducer});

    return (
        <section>
            <h1>Ditt konto</h1>
            <div>
                <p>NAME</p>
                    {nameState}
                <p>EMAIL</p>
                    {emailState}
                <p>PASSWORD</p>
                    {passwordState}
            </div>
            <button onClick = {() => history.push('/account')}>Ã„ndra</button>
        </section>



    )
}

export default ChangeAccount;
